import React from 'react';
import '../index.css'; // Import your index.css file

const Live = () => {
  return (
    <div>
      <h2>Live</h2>
      <div className="live-video-container">
        <iframe
          title="Live Stream"
          src="https://www.youtube.com/embed/live_stream?channel=UCB0ICkXvHJYHnBkhgkmcseQ"
          frameBorder="0"
          allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
        />
      </div>
    </div>
  );
}

export default Live;
